create table BilletService (
	id INT primary key identity,
	num_billet VARCHAR(50) NOT NULL UNIQUE,
	id_voiture INT FOREIGN KEY REFERENCES voiture_service (id_voiture),
	id_client INT  FOREIGN KEY REFERENCES client (id),
	date_de_reception DATE,
	date_de_retour DATE
);

drop table BilletService
SET IDENTITY_INSERT BilletService ON;
select * from BilletService
where date_de_reception > date_de_retour;

